import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Home from "./home/home";
import CadUser from "./Caduser";

class App extends Component {
  constructor() {
    super();
    this.state = {
      ListaUsuario: [
        {
          nome: "carlinho",
          email: "c@linhos.com"
        }
      ]
    };
  }
  render() {
    return (
      <div className="App">
        <Home />
      </div>
    );
  }
}

export default App;
